import Product from "./Product";
function Products() {
    return (
        <div className="products">
                <Product name="Iphone 14" price="72000"/>
                <Product name="Samsung s23 Ultra" price="129000"/>
                <Product name="Pixel 7" price="79000"/>
        </div>
    );
}

export default Products;
